"use strict";$("#role-button").click(function(){var e=$(this).data("user").split(",");$("#role-dialog").dialog({modal:!0,buttons:{Save:function(){var o=$("#role-select").val();o!==e[1]&&$.ajax({url:"/changeUserRole",type:"POST",data:{userId:e[0],role:o},success:function(o){console.log("Роль успешно изменена")},error:function(o){console.error("Ошибка при изменении роли: ",o)}}),$(this).dialog("close")},Cancel:function(){$(this).dialog("close")}}})});